import { describe, expect, test } from 'vitest';
import { getTextBySize, request } from '../../../__tests__/utils';
describe('reqSpeed', () => {
    test('ok', async () => {
        let now = Date.now();
        await request({
            url: 'http://reqspeed.test.whistlejs.com/',
            method: 'post',
            body: getTextBySize(128 * 2 + 1)
        });
        now = Date.now() - now;
        expect(now).toBeGreaterThan(2000);
    });
});
